-- CONDITIONAL DROP STATEMENTS

DROP TABLE IF EXISTS CAR_CRASH_TESTS;
DROP TABLE IF EXISTS CAR_MODEL;
DROP TABLE IF EXISTS CAR_BRAND;
DROP TABLE IF EXISTS CARS;

-- TABLES CREATION

CREATE TABLE CARS (
    Id BIGINT,
    Brand VARCHAR(50),
    Model VARCHAR(50),
    CarYear INT,
    StartingPrice DOUBLE,
    SoldUnits BIGINT
);
CREATE TABLE CAR_BRAND (
    BrandId VARCHAR(8) PRIMARY KEY,
    BrandName VARCHAR(50) NOT NULL
);
CREATE TABLE CAR_MODEL (
    ModelId VARCHAR(8) PRIMARY KEY,
    BrandId VARCHAR(8) NOT NULL,
    ModelName VARCHAR(50) NOT NULL,
    ModelYear INT NOT NULL,
    StartingPrice DOUBLE NOT NULL,
    SoldUnits BIGINT,
    CONSTRAINT CAR_MODEL_FK FOREIGN KEY (BrandId) REFERENCES CAR_BRAND (BrandId)
);
CREATE TABLE CAR_CRASH_TESTS (
    CrashId VARCHAR(8) PRIMARY KEY,
    ModelId VARCHAR(8) NOT NULL,
    TestDate DATE DEFAULT SYSDATE() NOT NULL,
    TestRating FLOAT DEFAULT -1,
    CONSTRAINT CAR_CRASH_MODEL_FK FOREIGN KEY (ModelId) REFERENCES CAR_MODEL (ModelId)
);

